import React from 'react';
import Item from './Item'

const List = ({ pokemon }) => {
    return(
        <ul>
            {pokemon.map((pokemon, index) => (
                <Item 
                    key={'pokemon', index}
                    name={pokemon.name}
                    sprites={pokemon.sprites}

                />
            ))}
        </ul>
    );
};

export default List;
